// TallestVine ///////////////////////////////////////////////////////////////////////////////
int NextVine(int x)
{
	int sum = 0;
	int original = x;
	while (x > 0) {
		sum = sum + (x % 10);
		x = x / 10;
	}
	return sum + original;
}

int Max(int a, int b) {
	if (a > b) {
		return a;
	} else {
		return b;
	}
}

int TallestVine(int startA, int startB, int days)
{
	int i, j;
	int vineA = startA;
	int vineB = startB;

	for (i = 0; i <= days; i++) {  // NOTE: less than or equal to length, so we test last value in sequence
		vineB = startB;
		for (j = 0; j <= days; j++) { // NOTE: likewise - the test happens before the growth
			if (vineA == vineB) {
				return vineA;
			}
			vineB = NextVine(vineB);
		}
		vineA = NextVine(vineA);
	}

	// If we haven't returned, then the vines did not meet.  Generate them again, as the above loop iterates one additional time.
	vineA = startA;
	vineB = startB;
	for (i = 0; i < days; i++) {
		vineA = NextVine(vineA);
		vineB = NextVine(vineB);
	}
	return Max(vineA, vineB);
}

